      baseLengthUnit: HeaderTableUnitAttributes["BaseLength"],
      columnName: `${ChartTableAttributes.Twist} ${TwistBaseLength.FormattedReportValue} ${HeaderTableUnitAttributes["BaseLength"]}`,
